    "2013-03-15T21:28:07.509176",nt"name": "hydrologic-landscape-regions-of-nevada",nt"isopen":
    false,nt"url": null,nt"notes": "Hydrologic landscape regions group areas
    according to their similarity in landscape and climate characteristics. These characteristics
    represent variables assumed to affect hydrologic processes in the environment. Hydrologic
    landscape regions in Nevada were delineated using geographic information system
    tools and statistical methods including cluster analysis. The data layers of hydrogeology,
    precipitation, soil permeability, land surface slope and aspect were used to identify
    the hydrologic landscape regions. Sixteen hydrologic landscape regions were identified
    through cluster analysis. The hydrologic landscape regions are noncontiguous in
    nature and can range from small areas which tend to be in the mountain ranges to
    very large areas in the basins.",nt"license_title": null,nt"extras": [{ntt"key":
